import React from "react"
import './style.css';

function Header() {
  return (
    <header id="top">
      <img src="art-web\src\yo.gif" alt="workinnit" border="0" />
       {/* <img src="https://i.ibb.co/gDhkRZv/redber.jpg" alt="berserk"/>*/}
        <div id="wr-sec">
          <p id="subtit">Visual Arts</p>
          <p id="name">Ali Naqvi</p>
        </div>
    </header>

  );
}

export default Header;
